INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (4,132,'Training spots',1528488884323,0,0,'To leech, lowest lvl require is 20 lvls under\r\rMonster lvls (location)\r\r59 (fog, @goto fog)\r68-70 (pirate den, @goto herb, go right till you see the aligators and then go up to the secret portal) (8.8k-9.5k exp)\r80 (wolf spiders, nlc) (10.5k exp)\r100 (himes, mushroom shrine)\r113 (skelegons, @goto skelegon)\r131 (tot obv 4)\r150-160 (omega)\r',2,2),
 (5,244,'o3o',1528942988344,0,0,'baka\r\r\r\r\rsmells',2,3),
 (6,238,'Discord',1529893211762,0,0,'Feel free to join the discord for FAQ, training info, server updates and more.\r\rMy name on the Discord is Tyr, and \rCelestia is L7weenie.\r\rAsk anything you want/need to know.\r\r\r\rhttps://discord.gg/25q8jHA',9,1),
 (7,238,'Bishop Training Guide',1529969522114,0,0,'Training;\r1 - 20 > Quests\r20 - 35 > Kpq, Boars, Quests\r36 - 51 > Jr. Wraiths, Wraiths, Zombie Mush\r51 - 60 > Ghost Ship 1/2\r*60 > Pirate leech if you can get someone\r60 - 70 > Ghost Ship 1/2\r70 - 85 > Zombies/Dead Mine\r85 - 120 > Himes/Anegos at Mush Shrine\r*Beware of Black Crow\r120 - 140 > Himes/Anegos\r140 - 170 > Skelegons\r170 - 200 > Revamped Omega/ToT (soon)',9,2),
 (8,238,'Helpful Things',1529969673788,2,0,'\rPerma Haste\rput @haste in a macro skill to give haste \rwhen you buff yourself.\r\rCheck @goto commands to make travel \reasier.\r\rAsk a GM (LightRyuzaki/Lee/Kuuyki) to\rassist you if you need Genesis, other skills that aren\'t popping up for your class.\r\rBuy a pet (auto pot works).\rBuy Aura Rings to level them up and gain \rextra stats.\r\rRemember to vote every day. Ask for help if you need anything.\r',9,3);
INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (9,272,'Healthy Training guide',1530198460302,0,4,'This is what I did to level. \r(bishops are weak)\r\rThere may be better options.\rFeel free to ask alliance.\r\rLevel 10-21 \r(@goto nlc) talk to mayor in the middle take his quiz repeat until you\'re bored\r\rLevel 30-50 \rkerning city subway (good spawn)\rkill jr wraiths then move up to wraiths around level 40\r\rLevel 50-70\r(@goto mp3) good spawn they hit hard at first but it gets a lot easier plus the spawn is good\r\rLevel 75-90 \rI moved into the ship at mp3 \ror go to pirates in herb town \r\rLevel 90-120\rhimes (@goto shrine)\r\rgo to top of crows nest 2 and go all the way right. ',11,1),
 (10,272,'Job advancements ',1530637343020,0,0,'Level 10 <1st job>\r\r@goto henesys (bowman)\r@goto perion (warrior)\r@goto ellinia (magician level 8)\r@goto nautilus (pirate)\r\rLevel 30 <2nd job advancement>\r\rgo to 1st job instructor talk to him and then find second job instructor. \r(google location  if you don\'t know)\r\rLevel 70 <3rd job advancement> \r\rYou need a DARK crystal \r(forged from 10 dark crystal ore)\r\r@goto elnath \rinstructor is in the middle of town in the big building\r\r(google where your dimensional portal is)\rfight job instructor clone\rgo back to 3rd job instructor\r\rgo to sharp cliff 2 there\'s a hidden portal on the top right side',11,2),
 (11,272,'Job advancements (cont.)',1530197621464,0,0,'GOOGLE ANSWERS FOR 3RD JOB ADVANCEMENT\r\rYou get 1 try per dark crystal.\r\rLevel 120 <4th job advancement> \r\rspeak with 3rd job instructor \rgoto valley of antelope(top right)\rtalk to 4th job instructor \rYou have two options \r1 kill manon/griffey\r2 pay 10mil for a scroll (seller located in ludibrium tower keep going down til you see him)\r\rspeak to 4th job a 2nd time after youve advanced to unlock more skills. the few that aremissing u need to get from skill books.  \r\r  ',11,3);
INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (12,272,'Beauty',1530030550975,0,0,'Mazra (M) or Shati (F) in henesys \r\ryou can change \r1)eyes\r2)hair \r3)skin\r\rhenesys vip hair coupon (cash shop)\r\rbig headward in henesys hair salon\r\rmore royal hair and eye choices \r\rYou get nx from killing monsters ',11,4),
 (13,280,'Attacker Training Guide',1530388418764,0,0,'10-30: nlc quiz\r30-38: musroom kingdom quests (can go higher here)\r39-70: FOG use @goto fog\r70- 80 wolf spiders @goto wolfspider\r80-120 Himes\r95-120 zakum leech from me (alpha) do the preqs!\r',11,5),
 (15,272,'GPQ guide',1530160360456,0,0,'\nRequirements\r\n\r\nA Level 30 or lower character.\r\nA Magician with Lv17 or higher Teleport.\r\nA Thief with Dark Sight.\r\nDecent attackers for Ergoth (He\'s a bit harder than Headless Horseman).\r\nOne ranged character.\r\nParty Leader has to be a Junior.\r\n\r\nEntry Stage - Protector Rock\r\n\r\nHit the rocks to get Protectors Rock.\r\nWear the Protectors Rock at all times in Guild PQ!\r\n\r\n',11,7),
 (16,272,'GPQ Stage 1',1530160637178,0,4,'\nStage 1 - Combination Stage\r\n\r\nYou have to find 3 combinations of statues.\r\r\nThree people have to work together to see the combination, which is shown with flashing of statues. \rEach person takes a part: Left, middle and right.\r\r\nThis has to be done THREE times; once with 4 statues as combination, once with 5 and once with 6. IF you fail, you have to start over.\r\r\nHit the right statues in the respective order to succeed the combination and move on to the next one.\r\n\rTip: Let each person shout out when a statue flashed, as well as the number of it. So the first statue flashes and player A says',11,8);
INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (17,272,'GPQ Stage 2',1530160947619,0,4,'Stage 2 - Spears of Longinus\r\n\r\nFirst, kill the Muscle Stones for a Key.\r\nUse the Key to enter the Room of Faith with a Thief with Dark Sight and a Magician with Teleport\r\r\nThe Mage teleports across the rubble to get a key, which the Thief uses to open the door at the end of the walk with the Lv200 rocks (using Dark Sight)\r\r\nThe Thief collects the first spear.\r\nDo the 3 Jump Quests in the Room of Glory\r\r\nTake the 4 Spears to the Room of Justice. The left JQs require Haste, the rightmost requires Teleport. The other JQ is a combination JQ (like the Ludi PQ one); the combination is 2 1 5 2 2 1 2',11,9),
 (18,272,'GPQ Stage 3',1530163166367,0,0,'Stage 3 - Mastermind\r\n\r\nCollect all four Items from the monsters and the boxes in the rooms. Of each item there are four; don?t pick them up, since only you can drop and pick them up again\r\rLet the Party Leader pick up everything\r\r\nThe Party Leader has to find the right combination\r\r\nYou have 7 tries\r\rThe NPC tells you which items are correct, \rin the combination (but not on the right spot) or not in the combination at all.\r\rThis is very similar to the game Mastermind,thus the name.\r\rCheat: Clicking End Chat will prevent the monsters from spawning!',11,10),
 (19,272,'GPQ Stage 4 + 5 ',1530163441822,0,0,'Stage 4 - Skeleton\r\n\r\nDo the 2 Jumping puzzles\r\r\nLet the Level 30 or lower character go in therespective room and kill the monsters to aquire the item\r\r\nKill the top Gargoyles using either an Arch Mage or Haste/Teleport.\r\nDrop the items in the right order on the Skeleton: Shoes > Bottom > Top > Hat.\r\rStage 5 - Sacrifice\r\n\r\nOne person (preferably the Level 30 or lower) has to drop his/her Earrings in the designated spot, so he/she is sacrificed RIP\r\r\nPeople who can fight Ergoth can enter the grand entrance\r\rothers may use one of the broken mouse holes in one of the poles on the wall to enter',11,11);
INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (20,319,'Simple Training Guide',1530247574433,0,0,'1-10: Maple Island or Henesys hunting ground\r\r11-30: Job quests and NLC Mayor Quiz Quest. Ludi Teddy.\r\r31-51: Ludi Teddy; Chronos, FOG\r\r52-70: Ghost Ship 1 and 2\r\r71-90: Pirates \r\r91-120: Himes leech\r\r120+: Skelegons and boss\r\rYou don\'t have to follow this guide but you can use this a lead.\r\n ',13,0),
 (21,319,'Commands And NPC',1530247567219,0,0,'If you\'re new to the server, there is a meet a gm event where the gm will give you a hat with +10 stats and 50k nx! Go say \"Hi\" to a GM.\r\rHairstyler and Face Surgey are free in Henesys.\r\r@goto <city> - for fast travel. You can also use it to go to zakum, horntail and skelegon.\r\r@dispose - for when your character is stuck, If your account is stuck, you can fix that via the website. \r\r@rates - rates are 8x 3x 3x. There are daily 2x EXP so watch out for those\r\r',13,1),
 (22,72,'Prices',1530252252185,0,0,'Zakum runs (they get the loot)\r10 mill solo + 5 mill for each addition\r2 mill for Eye of fire\r\rWhite scrolls 50 mill\r',7,1);
INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (23,238,'Farming Spots',1530817196384,2,0,'*Keep all of your Maple Leaves, they are \rVERY valuable.\r\rFarming locations;\r\rMaple leaves > Himes/Dreamy \rGhost (lv90+), Ant Tunnel Dungeon (lv30+), Galloperas in Fantasy Theme Park (lv100+).\r\rStiff Feathers > Yetis at Sharp Cliff I (lv85).\rStirges in Kerning Subway (lv25+). Wild \rBoars at Wild Boar Land in Perion (lv25+).\r\rSoft Feathers > Yetis at Sharp Cliff I (lv85+).\rGrupins/Lioners/Cellions in Orbis \r(lv35+).\r\rFlaming Feathers > Skeles @goto \rSkelegon (lv110+). Himes/Dreamy Ghost \r(lv100+).\r\rGold Teeth > Dead Mine III Bottom Plat\r(lv90+).\r\rPiece of Ice > Yetis at Sharp Cliff I (lv85+).',9,4),
 (24,318,'Training guide 1-120 1',1531286910431,0,0,'Many players ask this question daily. It has been quite a nuisance to repeat the same answer over and over, so I will keep this as short but informative as possible. It is not the best, but this is what I did to reach level 120.\r\r1~10: Beginner Island/Ereve (@goto Ereve)\r\r10~30: Quests. This server has 4x quest exp, so doing quests at a low level can be quite rewarding. Some quests such as; The Legend of Manon, Job Instructor and Training instructor quests.\r\r25~30: (OPTIONAL) Teddy\'s in Ludibrium. @goto Ludi',15,1),
 (25,318,'Training guide 1-120 2',1531286950147,0,0,'Level 30~38: I STRONGLY recommend you do the quests for Mushroom Kingdom. It is very rewarding and can be a very fast way of leveling up. \r\r\nLevel 30~45: (OPTIONAL) Grind at teddy\'s and Chronos in Ludibrium. The teddys are level 31.\r\r\nLevel 38~45: Grind at Chronos in Ludibrium. The Chronos are level 43.\r\r\nLevel 45~60: Grind at FOG - Forest of Golems. @goto fog. Depending on your class, if you went with warrior, brawler, mage or bandit, you may go to this place. The golems are level 57 and 59. This zone is buffed, meaning the spawn rate and exp given is higher than usual.\r\n',15,2);
INSERT INTO `bbs_threads` (`threadid`,`postercid`,`name`,`timestamp`,`icon`,`replycount`,`startpost`,`guildid`,`localthreadid`) VALUES 
 (26,318,'Training guide 1-120 3',1531286709837,0,0,'45~60: If you went with a long-range class such as gunslinger, assassin or bowman, then I recommend sticking to Chronos if you\'re not good at spacing.\r\r\n60~90: For the next period of leveling up, you will be grinding at pirates. The pirates are level 70. This zone is buffed, meaning the spawn rate and exp given is higher than usual. To get to pirates you type \"@goto herb\" and enter through a broken cage in Old Swamp which can be located on top of the area.\r\n',15,3),
 (27,318,'Training guide 1-120 4',1531286746357,0,0,'90~120: Himes. Himes give a total of 36k exp a kill so grinding at himes can be VERY rewarding, especially during 2x events. This spot is not for everyone though. It is highly recommended you grind here if you are a close-range class or a mage. It also works for ranged classes, but you will have to be dependent on partying up with someone. Expect leveling up to be quick.\r\rIf you have any better spots or suggestions for this guide feel free to let me know! ',15,4);
