INSERT INTO `bit_events` (`id`,`title`,`author`,`date`,`type`,`status`,`content`,`views`,`locked`) VALUES 
 (1,'Open Beta!','LightRyuzaki','04.30','ct_news_event_info','Active','<p>Maplers,</p>\r\n\r\n<p>Due to the server receiving constant Bug fixes as well as WZ updates we will be compensating players with daily 2x events! In addition to daily 2x events all players involved in the beta will recieve each of the following upon meeting one of the GM&#39;s:</p>\r\n\r\n<ul>\r\n	<li><span style=\"-webkit-tap-highlight-color:rgba(0, 0, 0, 0)\">Genesis Bandana w/ +10 all stat excluding wa and ma&nbsp;</span></li>\r\n	<li>50,000 NX to be spent within the cash shop</li>\r\n</ul>\r\n\r\n<p>Enjoy!</p>\r\n\r\n<p>Team Nano</p>\r\n\r\n<p>&nbsp;</p>\r\n',194,0),
 (2,'July NX Gachapon','GMLightRyuzaki','07.09','ct_news_event_info','Active','<p>Players,</p>\r\n\r\n<p>The Nx gachapon in the Home map has been updated for the month of July. Rupi and Straw hat snowman now have over 50 New nx items ranging from weapons, armour, accesories, mounts and even pets! Try your luck for just 10mil!</p>\r\n\r\n<p><img alt=\"\" src=\"https://images-ext-1.discordapp.net/external/-qhAF2aUXuE1cBx9U1rJo5DaspEqcM3dNzFAYRtlYPI/https/i.gyazo.com/thumb/1200/51c08def2b0af462433779844d8814ca-png.jpg\" style=\"height:314px; width:531px\" /></p>\r\n\r\n<p>Team Nano</p>\r\n',40,0);
