INSERT INTO `bit_news` (`id`,`title`,`author`,`date`,`type`,`content`,`views`,`locked`) VALUES 
 (1,'Server is back up!','LightRyuzaki','04.30','ct_news_notice_notice','<p>Hey!</p>\r\n\r\n<p>The server is back up for the summer and there are some big changes happening with the source! Make sure to check the download page for the latest game download!</p>\r\n\r\n<p>LightRyuzaki and your ProjectNano Team</p>\r\n',57,1),
 (2,'Website Login Down','LightRyuzaki','04.30','ct_news_notice_notice','<p>Website login is currently down for player who have logged in to the game. We are working to fix this issue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Team Nano</p>\r\n',59,1),
 (5,'Website Login Up!','GMLightRyuzaki','05.27','ct_news_notice_notice','<p>Players,</p>\r\n\r\n<p>Website login now works, you can utilize all types of account fixes and content via logging in :)</p>\r\n\r\n<p>Team Nano</p>\r\n',100,0),
 (6,'Item Saving Optimization','GMLightRyuzaki','07.09','ct_news_gameup','<p><!--StartFragment--><strong>Developer Update:</strong></p>\r\n\r\n<p>Characters with abnormally long save times, some as much as <code>60 seconds</code>, were degrading server performance, causing rollbacks, and causing other issues. With the latest performance update, character save times have improved drastically. The longest it took a character to save was <code>3.5 seconds</code>. As a result, there should be less issues with inventories being rolled back. Hope you enjoy this Quality of Life update Keep nanoing</p>\r\n\r\n<p>- Lemon<!--EndFragment--></p>\r\n',29,0),
 (4,'[WZ]7/2/2017','LightRyuzaki','05.04','ct_news_notice_notice','<p>Players,</p>\r\n\r\n<p><!--StartFragment-->7/2/2017: LHC, Ulu City, and Ninja Castle mob and boss damage rebalance [<a href=\"http://www.mediafire.com/file/0h1e6neic83a25b/mob.rar\" target=\"_blank\">http://www.mediafire.com/file/0h1e6neic83a25b/mob.rar</a>] Please replace your pre-existing mob.wz with this one and they will now do the correct damage!<!--EndFragment--></p>\r\n\r\n<p><!--StartFragment-->[WZ Update] 5/23/2018 New Pets, Chat rings, and medals! [<a href=\"https://drive.google.com/open?id=1Ah_Gqw2jVGuYMPRYezU8icVID8Fd8PyS\" target=\"_blank\">https://drive.google.com/open?id=1Ah_Gqw2jVGuYMPRYezU8icVID8Fd8PyS</a>] Please replace your existing UI.wz and Item.wz<!--EndFragment--></p>\r\n\r\n<p>[WZ UPDATE] 5/22/2018: Lion Heart Castle : Lion Heart Castle has been added please download the following file and replace the files in your maple folder: <a href=\"https://drive.google.com/open?id=1vuWfVItbc5YY9jj8hmaQUcSCoJVjYGO0\">https://drive.google.com/open?id=1vuWfVItbc5YY9jj8hmaQUcSCoJVjYGO0</a></p>\r\n\r\n<p>Files Updated:</p>\r\n\r\n<ul>\r\n	<li>Mob.wz</li>\r\n	<li>String.wz</li>\r\n	<li>Npc.wz</li>\r\n	<li>Skill.wz</li>\r\n	<li>Map.wz</li>\r\n	<li>Sound.wz</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" src=\"https://i.gyazo.com/f9d09e3bb5cddca422723254681a8a22.png\" style=\"border-style:solid; border-width:2px; height:200px; width:488px\" /></p>\r\n\r\n<p>5/21/2018:</p>\r\n\r\n<p><!--StartFragment--><!--StartFragment-->[WZ UPDATE] Mob.wz: Omega Sector Revamp! Level 130-200 Party Training maps! [ <a href=\"https://drive.google.com/open?id=1cXItEC9XUROd0Zv-09UGilQ3a_jR5bhC\" target=\"_blank\">https://drive.google.com/open?id=1cXItEC9XUROd0Zv-09UGilQ3a_jR5bhC</a>]<!--EndFragment--> <!--EndFragment--></p>\r\n\r\n<p><img alt=\"\" src=\"https://i.gyazo.com/4de00ef2546f692d638ffdfa659b7d9f.png\" style=\"border-style:solid; border-width:2px; height:246px; width:574px\" /></p>\r\n\r\n<p>5/15/2018</p>\r\n\r\n<p><strong>String.wz Update:&nbsp;</strong> This file will update item descriptions for Use items. Mainly fixes scroll descriptions.</p>\r\n\r\n<p><a href=\"http://www.mediafire.com/file/xefazrftz9kpx8x/String.wz\">http://www.mediafire.com/file/xefazrftz9kpx8x/String.wz</a></p>\r\n\r\n<p>5/5/2018</p>\r\n\r\n<p><!--StartFragment--><strong>[WZ Update] </strong><!--EndFragment--></p>\r\n\r\n<p><strong>Bulk Update:</strong> Attached below is the Character.wz,String.wz,UI.wz,Item.wz,Map.wz,Base.wz,Reactor.wz,Quest.wz upto date with todays 5/5/2018 patch</p>\r\n\r\n<p><a href=\"http://www.mediafire.com/file/9eod1jwzdn73n2n/Character_Item_String_UI%20WZ%27s%20Fixed.rar\">https://drive.google.com/open?id=1FtjnURplBil-hft7mHQCx1LzwYQEN_Xy</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Single File Downloads: 5/5/2018</strong></p>\r\n\r\n<p>Quest.wz Update will fix many quests. ToT specifically [<a href=\"https://drive.google.com/open?id=0BzDsHSr-0V4MSDFFa1cyelk4UUk\" target=\"_blank\">https://drive.google.com/open?id=0BzDsHSr-0V4MSDFFa1cyelk4UUk</a>]</p>\r\n\r\n<p>String.wz:</p>\r\n\r\n<p><a href=\"http://www.mediafire.com/file/04x6m51f11xeuw6/String.rar\">http://www.mediafire.com/file/04x6m51f11xeuw6/String.rar</a></p>\r\n\r\n<p>5/4/2018</p>\r\n\r\n<p>Here is the Item.wz Update that will hopefully fix the exp/drop coupon disconnects</p>\r\n\r\n<p><!--StartFragment--><a href=\"http://www.mediafire.com/file/7ebebshs45sfnbg/Item.rar\" target=\"_blank\">http://www.mediafire.com/file/7ebebshs45sfnbg/Item.rar</a><!--EndFragment--></p>\r\n\r\n<p>-------------------------------------------------------------------------------------------------</p>\r\n\r\n<p><img alt=\"team nano\" src=\"https://i.gyazo.com/561f2ea88bfe478977b0e59b5eea8e1c.png\" style=\"height:164px; width:383px\" /></p>\r\n\r\n<p>Team Nano</p>\r\n',327,0);
INSERT INTO `bit_news` (`id`,`title`,`author`,`date`,`type`,`content`,`views`,`locked`) VALUES 
 (7,'Ulu + Ninja Castle + LHC Rebalance','GMLightRyuzaki','07.09','ct_news_gameup','<p>Maplers,</p>\r\n\r\n<p>Ulu city, ninja castle, and LHC have had all mob damage rebalanced to allow these area to be accesible to the general public now! You can access them by typing @goto ulu - castle - lhc</p>\r\n\r\n<p>Enjoy!</p>\r\n',51,0);
INSERT INTO `bit_pages` (`id`,`title`,`slug`,`author`,`content`,`visible`) VALUES 
 (1,'Project Nano\'s Feature List','featurelist','LightRyuzaki','<h1><a href=\"https://nisrockk.files.wordpress.com/2016/02/cropped-ms-banner1.jpg\"><img alt=\"\" src=\"https://nisrockk.files.wordpress.com/2016/02/cropped-ms-banner1.jpg\" style=\"height:160px; width:800px\" /></a></h1>\r\n\r\n<ul>\r\n	<li><strong>Himes,Pirates,FOG hp and exp adjusted</strong></li>\r\n	<li><strong>@whodrops &amp; @whatdropsfrom available to all players</strong></li>\r\n	<li><strong>@goto map </strong>-&nbsp;<strong>list of maps available: home, henesys, ellinia, perion, kerning, lith, sleepywood, florina, nautilus, ereve,rien,orbis, elnath,ludi, aqua,leafre,mulung,herb,omega,korean,ellin,nlc,gpq, pianus, mushmom, griffey,manon,horseman,balrog,zakum,papu,showa,guild,shrine,skelegon, hpq, ariant,magatia,singapore,cwk,amoria,temple,neo,fm,fog,mp3,ws,ulu,castle,home</strong></li>\r\n	<li><strong>Empress items obtainable from Puri Puri in henesys via Vote points</strong></li>\r\n	<li><strong>All pq&#39;s have no max level limit &amp; give 10x exp</strong></li>\r\n	<li><strong>Mazra Male Stylist in henesys.</strong></li>\r\n	<li><strong>Shati female stylist in henesys.</strong></li>\r\n	<li><strong>Bigheadward Premium Hair &amp; Face Stylist in @goto home</strong></li>\r\n	<li><strong>Gaga in henesys starts the Boss PQ (edited).</strong></li>\r\n	<li><strong>CafePQ : Speak to Mong from Kong in Kerning to be moved to CafePQ lobby to recieve various rare items</strong></li>\r\n	<li><strong>Rupi &amp; Strawhat Snowman: New NX Gachapon for 10million mesos</strong></li>\r\n	<li><strong>Mia: Maple Leaf trade NPC (Eye of Fire available through her)</strong></li>\r\n	<li><strong>Abdula NPC in henesys : tells you what drops your skill books</strong></li>\r\n	<li><strong>Agent E in henesys will craft accesories and weapons</strong></li>\r\n	<li><strong>Inkwell Henesys : trade your perfect pitches for rare items</strong></li>\r\n	<li><strong>@rebirth command (Obtain level 200 and Golden Maple leaf to Rebirth)</strong></li>\r\n	<li><strong>Omega Sector level 130+ Training maps!(More Updated to come)</strong></li>\r\n	<li><strong>Level 120 Maple Renegades weapons drop from zakum</strong></li>\r\n	<li><strong>Empress items Obtainable from Horntail</strong></li>\r\n	<li><strong>Fafnir Weapons craftable via Agent E </strong></li>\r\n	<li><strong>Ulu City Added!</strong></li>\r\n	<li><strong>Ninja Castle Added! </strong></li>\r\n	<li><strong>Trade Button now warps to [@goto home] map</strong></li>\r\n</ul>\r\n\r\n<p><!--EndFragment--></p>\r\n',1),
 (2,'Servers Rule','serverrule','Evol','<center><p><a href=\"http://nxcache.nexon.net/umbraco/4631/gms.jpg\"><img alt=\"\" src=\"http://nxcache.nexon.net/umbraco/4631/gms.jpg\" style=\"height:185px; width:540px\" /></a></p></center>\r\n\r\n<ul>\r\n	<li><em><strong>Server Abuse</strong></em><br />\r\n	Server abuse includes illegal activities, such as attacking Project Nano&#39;s server, unofficial commerce; including the advertising of other MapleStory private servers.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Illegal Activities</strong></em><br />\r\n	Blatant illegal activities, or attacks occurring on or towards any server used in connection with Project Nano services are prohibited. Illegal activities are felonies and/or misdemeanors and can result in incarceration and/or fines. We consider all of you adults with the capacity to make your own decisions.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Illegal Trading</strong></em><br />\r\n	Any unofficial advertising and/or sale of goods or services (either real-world or in-game) for real-world currency, including but not limited to the promotion of other MapleStory private servers or the purchase/sale of accounts, mesos, items, or leeching, is prohibited.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Game Abuse</strong></em><br />\r\n	Game abuse includes the use of third party software for hacking, packet editing, wz editing or botting. As well as internal and external mechanisms such as vote abuse, glitch abuse, duping, account sharing and ban evasion.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Botting</strong></em><br />\r\n	All forms of botting are prohibited. This includes the use of third party software and/or paperweights to gain an abnormal advantage over others. Project Nano&#39;s staff members reserve the right to randomly test if you&#39;re botting.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Vote Abusing</strong></em><br />\r\n	All forms of vote abuse are prohibited. This means that you may only vote once every 24 hours regardless of how many accounts you own. While we allow our players to create multiple accounts, you may only vote for one account.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Player Abuse</strong></em><br />\r\n	Player abuse includes the harassment of players via verbal threats, kill stealing, or mass defamation, in addition to deceptive techniques such as scamming, false reports, and staff impersonation.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Staff Impersonation&nbsp;</strong></em><br />\r\n	The impersonation of Project Nano&#39;s staff members is prohibited.&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Scamming&nbsp;</strong></em><br />\r\n	Scamming players is not tolerated. This includes obtaining an item from a player via a method unintended by the other player. For example, agreeing to trade items for another and then deceiving the player by putting up different items would be deemed scamming. Simply putting up an item in a Hired Merchant will not fall under the jurisdiction of this rule.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>False Reports&nbsp;</strong></em><br />\r\n	The creation of false reports is prohibited. This means that when a player attempts to report another player for abuse in a manner that uses deception to get one banned. An example of this would involve the editing or selective positioning of a screenshot to make it look like a player is abusing when he/she is not.<br />\r\n	&nbsp;</li>\r\n	<li><em><strong>Notes</strong></em><br />\r\n	Keep in mind that Project Nano&#39;s staff members reserve right to ban you for any reason which they deem is abusive, disruptive, or otherwise has a negative impact on the server. If you believe that you were unfairly banned, please create a ban appeal.</li>\r\n</ul>\r\n',1);
